import { AppBar, Toolbar, Box, styled } from '@mui/material';

const StyledHeader = styled(AppBar)`
    background: #FFA500;
    height: 55px;
`;

const Header = () => {
return (
    <StyledHeader position="fixed">
        <Toolbar>
           <img src='./../public/logo.png'/>
        </Toolbar>
    </StyledHeader>
)
}


export default Header;
